description:
This torrent contains all 8 Star Wars - The Clone Wars Story Reels.


It contains all four Story Reel episodes from the Crystal Crisis on Utapau arc:

1.)  &quot;A Death on Utapau&quot;
2.)  &quot;In Search of the Crystal&quot;
3.)  &quot;Crystal Crisis&quot; 
4.)  &quot;The Big Bang&quot; 


It also contains all four Story Reel episodes from the Bad Batch arc:

5.)  &quot;The Bad Batch&quot;
6.)  &quot;A Distant Echo&quot;
7.)  &quot;On the Wings of Keeradaks&quot;
8.)  &quot;Unfinished Business&quot;



All files are .mp4, enjoy!
